const initState = {
    families: [
        {lastName: "Loudermilk", numOfMem: "4", guests: "1"},
        {lastName: "Dodd", numOfMem: "3", guests: "0"}
    ]
}

const familyReducer = (state = initState, action) => {
    return state;
}

export default familyReducer
